import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import ListGroup from 'react-bootstrap/ListGroup'
import Button from 'react-bootstrap/Button'

const NonList = (props) => {

  const renderNons = props.nonograms.map(nonogram =>{
    if(nonogram.id!=0){
      return(
      <ListGroup.Item variant="primary">
        <Link key={nonogram.id} to={`/nonograms/${nonogram.id}`}>
          {nonogram.width}x{nonogram.height} {nonogram.name}
        </Link>
         {'\xa0'} Score: {props.score}
        <Button key={nonogram.id} onClick={props.handleUpvote}>Upvote</Button>
        <Button key={nonogram.id} onClick={props.handleDownvote}>Downvote</Button>
      </ListGroup.Item>)
    }
  }
  );
  return (
    <ListGroup style={{width: '60%', marginLeft: 'auto', marginRight: 'auto', marginTop: '20px'}}>
      {renderNons}
    </ListGroup>
  );
};

export default NonList
